INSERT INTO `events` VALUES (1,1,'Senior Community Service Employment Program','The Senior Community Service Employment Program (SCSEP) is the nation\'s oldest program to help low-income, unemployed individuals aged 55+ find work. AARP Foundation first matches eligible older job seekers with local nonprofits and public agencies so they can increase skills and build self-confidence, while earning a modest income. Based on their employment interests and goals, participants may also receive supportive services and skills training through an educational institution. Their SCSEP experience most often leads to permanent employment.',18.220833,-66.590149,'elderly','Puerto Rico'),(2,1,'Drive To End Hunger','Since 2011, AARP Foundation’s Drive to End Hunger campaign has been raising awareness about the problem of food insecurity among older adults, meeting the immediate daily food needs of hungry seniors, and working to establish permanent solutions to end senior hunger once and for all. Through a collaboration with NASCAR team owner Rick Hendrick of Hendrick Motorsports, four-time Sprint Cup Champion Jeff Gordon, Hendrick teammate Kasey Kahne, and both public and private sector organizations, Drive to End Hunger has donated more than 37 million meals to help feed hungry seniors across the country.',35.517491,-86.580447,'hunger','Tennessee'),(3,1,'Improving Access to Safe and Affordable Housing','By 2030, one in every five Americans will be over age 65, and our nation will face a severe shortage in appropriate housing to meet their needs. As people age, they need housing that is structurally and mechanically safe and that accommodates people with disabilities. Those 50 and older also need safe communities, adequate transportation options and access to grocery stores, doctors and community activities. AARP Foundation is developing strategies to address the senior housing crisis and make all of our communities affordable and welcoming for people regardless of age or physical ability.',40.763775,-74.005973,'elderly','New York'),(4,1,'connect2affect','Isolation is more than being alone. It’s the result of feeling detached physically or psychologically, or being disconnected from support groups of family, friends and community. More than 8 million adults age 50 and older are affected by isolation. The health risks of prolonged isolation are equivalent to smoking 15 cigarettes a day.',40.712775,-74.005973,'elderly','New York'),(5,2,'Acorns Bubble Rush','Starting in a sea of bubbles, you\'ll make your way round the course whilst our Bubble Commandos fire frothy milkshake bubbles from their foam cannons. You\'ll visit different coloured bubble stations along the route as you run, jog, walk or dance your way to the finish line.Don’t worry if you’re not a runner, Bubble Rush is not timed and is all about having fun whilst raising vital funds for local life limited children and families that need us. All ages and abilities are welcome, and the course is wheelchair and pushchair friendly.',52.195244,-2.231683,'children','UK'),(6,2,'Great Midlands Fun Run','Start the summer on a high by taking part in the fantastic Great Midlands Fun Run. This 8.5 mile course sees you starting off in Sutton Coldfield town centre, making your way through the picturesque Sutton Park, through the Four Oaks Gate, before being welcomed through the finish line by hundreds of cheering supporters! The Fun Run is perfect for the whole family, with all ages and abilities welcome – so dust off those running shoes and get involved!',52.475074,-1.829833,'children','UK'),(7,2,'Skydive','magine standing at the edge of an open doorway in an aircraft flying at 10,000 feet – the noise of the engines and the wind ringing in your ears with only the distant field below. Now imagine leaning forward out of that doorway and letting go – falling forward through the air as you start freefalling at over 120mph! Then imagine the peace and quiet as the canopy opens, your fall slows and you gently return to earth. Participants are required to raise a minimum sponsorship of £500; this covers the cost of the £50 registration fee, the jump at approximately £200 per person and raises £250 for Acorns Children\'s Hospice.',52.927310,-2.649468,'children','UK'),(8,3,'Vitality London10,000','With a race that starts and finishes in St. James’s Park and passes many of London’s famous sights, including Westminster Abbey, The Houses of Parliament, Big Ben, The London Eye, Cleopatra’s Needle and Nelson\'s Column, you can see the sights and sounds of the capital while completing a fantastic personal challenge. Why not challenge a team of your friends to get involved too? Every step you take helps to take us closer to ending child hunger for good.',51.502460,-0.134811,'hunger','UK'),(9,3,'Virgin Money London Marathon','We ask each marathon runner to pledge to raise £2,000 when they accept a place on our team, and to pay a registration fee of £60 (inc. VAT) to secure their place on the team. Join the team to help us create a world free from hunger.',51.507351,-0.127758,'hunger','UK'),(10,3,'TCS New York City Marathon','The New York Marathon is renowned as the biggest and best supported marathon in the world, with 38,000 entrants and 2 million spectators lining the streets each year. The race takes runners through each of New York\'s five diverse boroughs and finishes in the spectacular Central Park. We do not set a minimum sponsorship target for this event, however, if you are able to raise £1,300 or more for our programmes you will be eligible to claim reimbursements towards your travel and accommodation costs for the event.',40.782865,-73.965355,'children','New York'),(11,4,'Legacy Giving','Leaving a gift in your will is a meaningful way of making a lasting contribution to the support to deaf people. Every gift left to AD makes a difference to the people we support, allowing us to provide high-quality services that meet their changing needs across East Midlands and the UK.',52.455518,-1.174320,'health','UK'),(12,4,'Give as you Live','AD is now signed up to Give As You Live, an online tool which allows our supporters to donate by shopping online. Thousands of retailers such as Amazon and Sainsbury’s have signed up to donate a percentage of every online purchase you make to your chosen charity at no extra cost to you. So support us while you shop and sign up to Give As You Live today!',52.655518,-1.374320,'children','UK'),(13,5,'Campaign for women’s rights','All over the world women and girls have less money, less access to education, and less political representation than men. But in every country, inspiring women activists are standing up and working together to claim back their rights. We’re standing with them. Will you?',52.955518,-1.674320,'equality','UK'),(14,5,'Campaign to make tax fair','Every year, poorer countries lose out on estimated $200 billion to corporate tax dodging – more than the entire global aid budget. We don’t think that’s fair, and that’s why we’re part of the global campaign to stop tax dodging. It’s time to make tax fair – everywhere.',42.733883,25.485830,'equality','Bulgaria'),(15,5,'Campaigning works','ActionAid campaigns change lives. Through tireless campaigning, our supporters have influenced governments and corporations to get a better deal for some of the world’s most vulnerable people. There’s a lot still to do, but we’re proud of the incredible changes ActionAid campaigners have already won.',52.355518,-1.174320,'equality','UK'),(16,6,'Investment Sector(East Africa): Agriculture','Most of the world’s poor, nearly 2.5 billion people, live off the land. These smallholder farmers survive by farming small plots of land about the size of a football field. Their 500 million farms produce more than 70% of the global food supply, yet many of the people living on these farms are themselves struggling to survive. Our companies provide smallholder farmers with solutions that improve their productivity, give them access to markets and, ultimately, increase their incomes.',-0.246580,38.046875,'poverty','Kenya'),(17,6,'Investment Sector(East Africa): Energy','The world has made progress in increased energy for all over the last decade; however, the poor continue to be especially vulnerable economically, health-wise, and environmentally. Today, 1.06 billion people, or 13% of the world’s population, are living without it. Our companies—which are innovators in hand-held solar products, distributed power, clean cookstoves, and more— are changing this.',-0.446580,38.246875,'equality','Kenya'),(18,6,'Investment Sector(East Africa): Financial Inclusion','Around the world, financial inclusion plays a vital role in reducing poverty and inequality. The companies we invest in go beyond basic financial services to focus on full financial inclusion—companies that treat customers with respect, design solutions with customers needs in mind and, ultimately, help as many people as possible graduate out of the vicious cycle of poverty.',-0.646580,38.446875,'poverty','Kenya'),(19,6,'Investment Sector(East Africa): Health','Since our first health investment in 2001, we’ve supported a range of solutions providing healthcare products and services to low-income customers. From affordable emergency ambulance services, to healthcare education, to affordable eye care, to health insurance for families, our companies are positively impacting the lives of millions.',-0.846580,38.646875,'equality','Kenya'),(20,6,'Investment Sector(East Africa): Water & Sanitation','Worldwide, 1 in 9 people lack access to safe water while 1 in 3 people lack access to a toilet. Our investments in empower families with access to clean, safe drinking water and sanitation. These innovations not only improve the health and economies of low-income communities, they free up invaluable time, improve the health of communities and enable safety for women and children.',-0.546580,38.846875,'poverty','Kenya'),(21,6,'Investment Sector(India): Agriculture','Most of the world’s poor, nearly 2.5 billion people, live off the land. These smallholder farmers survive by farming small plots of land about the size of a football field. Their 500 million farms produce more than 70% of the global food supply, yet many of the people living on these farms are themselves struggling to survive. Our companies provide smallholder farmers with solutions that improve their productivity, give them access to markets and, ultimately, increase their incomes.',20.193684,78.962880,'poverty','India'),(22,6,'Investment Sector(India): Education','In many parts of the world, the price of education has typically correlated with the quality of education offered. We focus on making every aspect of the education system, from basic schooling to job placement for low-income students, accessible and affordable to generate paths out of poverty and create lifelong learning opportunities.',20.393684,79.162880,'poverty','India'),(23,6,'Investment Sector(India): Energy','The world has made progress in increased energy for all over the last decade; however, the poor continue to be especially vulnerable economically, health-wise, and environmentally. Today, 1.06 billion people, or 13% of the world’s population, are living without it. Our companies—which are innovators in hand-held solar products, distributed power, clean cookstoves, and more— are changing this.',20.593684,79.362880,'equality','India'),(24,6,'Investment Sector(India): Health','Since our first health investment in 2001, we’ve supported a range of solutions providing healthcare products and services to low-income customers. From affordable emergency ambulance services, to healthcare education, to affordable eye care, to health insurance for families, our companies are positively impacting the lives of millions.',20.793684,79.562880,'equality','India'),(25,6,'Investment Sector(India): Housing','Inadequate housing not only affects health and personal security, it is also part of a socioeconomic trap that limits the ability of people to feel safe, increase their incomes or improve educational outcomes. Our companies address both supply and financing for housing, as well as broader innovations that remove barriers to home ownership for low-income populations.',20.993684,79.762880,'equality','India'),(26,6,'Investment Sector(India): Water & Sanitation','Worldwide, 1 in 9 people lack access to safe water while 1 in 3 people lack access to a toilet. Our investments in empower families with access to clean, safe drinking water and sanitation. These innovations not only improve the health and economies of low-income communities, they free up invaluable time, improve the health of communities and enable safety for women and children.',21.193684,79.962880,'poverty','India'),(27,6,'Investment Sector(India): Workforce Development','There is significant need for innovation in workforce development in India and the United States. We invest in companies providing low-income students and job seekers the training and tools they need to access job placement services and succeed in building life-long careers, breaking the cycle of poverty for low-income families and communities.',21.393684,80.162880,'poverty','India'),(28,7,'Adelson program in cancer research - melanoma','About 60,000 new cases of malignant melanoma arise each year in the U.S. and 8000 people succumb to metastatic disease. Current melanoma therapies are ineffective, other than in small undefined subsets of patients. This suggests that there may be biologically distinct melanoma subtypes, and indicates the potential for targeted therapies. The APCR-Melanoma Biomarker Group Collaboration aims to identify the characteristics of subtypes that are most malignant using techniques like those employed by the APCR-Core.',41.499320,-81.294361,'health','Cleveland'),(29,7,'Adelson program in cancer research - core cancer','Although we commonly think of cancer of a particular organ such as the breast or lung as a single disease, basic science research points to the likelihood that many subtypes exist within each organ. A patient may bear a specific type of cancer cell that is best treated by a medication or vaccine or hormonal approach that has been developed for that specific target. One treatment will not fit all. The Core investigator Group has adopted a strategy that is based on the premise that the identification of the most useful new targets and the rational use of the resulting novel targeted therapeutics in the appropriate set of patients will require a thorough interrogation of the various types of genetic, epigenetic and molecular alterations that have occurred in cancerous tissues.',41.799320,-81.594361,'health','Cleveland'),(30,7,'Adelson program in neural repair and rehabilitation','The Dr. Miriam and Sheldon G. Adelson Medical Research Foundation is a private foundation committed to a model of open and highly integrated collaboration among outstanding investigators who participate in goal-directed basic and clinical research to prevent, reduce or eliminate disabling and life-threatening illness.',41.999320,-81.894361,'health','Cleveland'),(31,8,'Every drop matters','Mao has lost eight children to the effects of unsafe water. Each one was just a baby, the youngest only 3 months old. No parent should live with this pain. Eight tragedies that could have easily been prevented. And Mao’s story is just one of thousands like it around the world. No child should lose their life because of dirty water. There are families like Mao’s who need your help today. Without it, more children will die.',26.648262,107.379533,'health','China'),(32,8,'Food For Their Future','Hunger and malnutrition kill more people each year than AIDS, malaria, and tuberculosis combined. Today, nearly 1 billion people in the world are hungry and food is insecure. We envision a sustainable food-secure future  and actively work to addresses these complex causes. We do this by focusing on farmers’ increase of food supply, income and savings for food purchasing. We help women and children identify, prevent, and treat malnutrition before it impacts their long-term health. At the community-level we promote nutrition awareness using strategies that help households achieve diverse and nutrient-rich diets.',-8.803369,25.779084,'hunger','Republic of the Congo'),(33,8,'They Are Our Future','Children are among the most vulnerable to the hardships of living in poverty. Often their life circumstances deny them proper nutrition, a safe and sanitary environment, and basic education. We support vulnerable children at all levels of their growth by improving access to education, training teachers and care givers, and helping families afford school fees and supplies. In urban areas, we help children and youth reach their potential through school and after-school programs. Globally, we have established centers for children without a family where their emotional and physical needs are met and their futures nurtured.',-0.023559,37.906193,'children','Kenya'),(34,9,'How You Can Help','Hundreds of children rely on us – 24 hours a day, 7 days a week, 365 days a year – to provide them with outstanding care in a warm and loving environment.Please help us continue to provide them with the loving atmosphere and professional care they need to thrive. Your contributions to ALEH is tax deductible in the United States, United Kingdom, Canada, the Netherlands and Israel.',31.046051,34.851612,'children','Israel'),(35,10,'The Lemon Climb Houston','Participation in The Lemon Climb gives you the opportunity to make a difference in the lives of children and families facing childhood cancer while challenging yourself to walk, run, or race up 35, 60, or 75 flights of stairs to the top of the Chase Tower at 600 Travis. After your climb, go to the 60th floor sky lobby to enjoy views of the city before joining us at the after party in the outside plaza. The Lemon Climb Houston can be completed individually or climbers can create a team to fundraise together and generate more of an impact. Once registered, ALSF encourages you to share your fundraising page with friends, family and co-workers to reach your minimum fundraising goal of $100–which funds two hours of childhood cancer research.',29.760427,-95.369803,'health','Houston'),(36,10,'The Lemon Climb Denver','The Lemon Climb gives you the opportunity to help kids with cancer while challenging yourself to walk, run, or race up 43 flights of stairs to the top of the 1999 Broadway building. Following your climb, join us for an after party at the top of the building where you can enjoy light bites and sky high views. The Lemon Climb can be completed on your own or you can create a team of climbers and fundraise together to generate more of an impact. Once registered, ALSF encourages you to share your reason for climbing with friends, family and co-workers to collect online donations. It is $25 to register and participants must raise a minimum of $100 each–which funds two hours of childhood cancer research. ',39.739236,-104.990251,'health','Denver'),(37,10,'Alex\'s \"Original\" Lemonade Stand','The Lemon Climb gives you the opportunity to help kids with cancer while challenging yourself to walk, run, or race up 43 flights of stairs to the top of the 1999 Broadway building. Following your climb, join us for an after party at the top of the building where you can enjoy light bites and sky high views. The Lemon Climb can be completed on your own or you can create a team of climbers and fundraise together to generate more of an impact. Once registered, ALSF encourages you to share your reason for climbing with friends, family and co-workers to collect online donations. It is $25 to register and participants must raise a minimum of $100 each–which funds two hours of childhood cancer research. ',39.986934,-75.278224,'health','Philadelphia'),(38,12,'Bangladesh: Swim For Life Project','CIPRB and TASC have responded to the need for a \"vaccine against child drowning\" by launching a new water safety program in rural Bangladesh called \"Swim for Life, Bangladesh\". This program builds on the knowledge obtained in the national surveys about what age groups are most at risk and what community attitudes are about swimming and water safety. Volunteers are trained as community swimming instructors. Local swimming sites are improved as safe instructional venues. The programs targets children who are ready to swim but have not yet learned, ages 4-10. It emphasizes improved supervision for younger children. The program raises water safety awareness within the community.',23.684994,90.356331,'children','Bangladesh'),(39,12,'Bangladesh: Project SleepSafe','The Bangladesh Health and Injury Survey (2003) shows three infants accidentally suffocate every night in Bangladesh. It is not just Bangladesh; TASC estimates 53 infants suffocate each night across Asia. TASC proposes these accidental suffocations can be prevented in two simple ways. First, educate expectant mothers and fathers through antenatal care programs about the risks of suffocation and teach them how to reduce those risks when sharing a bed with the infant. Second, Introducing a protective cradle for the infant that can be used in the bed.',23.684994,90.356331,'children','Bangladesh'),(40,16,'Health Worker Training','Nearly 30 years ago, Amref Health Africa and GSK joined forces to distribute bed nets to communities at risk of malaria. Over the years since, our partnership has collaborated on projects focusing on malaria and HIV prevention, access to proper sanitation, and non-communicable disease prevention. Together we introduced the PHASE programme in Kenya to teach children the importance of handwashing and good hygiene practice. This programme has since been rolled out across 16 countries, reaching more than 1.5 million children. In our latest collaboration with GSK, we have teamed up to train frontline health workers through the GSK 20% Reinvestment Initiative (RI) programme. Launched in 2009, the initiative is now being implemented by Amref Health Africa across 13 different countries in Eastern and Southern Africa. This programme sees GSK reinvest 20% of profits generated in its least developed countries back into strengthening those countries’ healthcare systems. It is a sustainable model to help improve healthcare infrastructure long-term and improve access to healthcare.',-0.023559,37.906193,'health','Kenya'),(41,16,'Water Sanitation & Hygiene','Amref Health Africa UK, in partnership with Comic Relief, is improving the health of communities living within Ethiopia’s capital, Addis Ababa, by improving the access to water and sanitation facilities. The informal settlements in Yeka and Akaki Sub Cities have high levels of poverty, poor housing and illiteracy. Sanitation is a particular issue. In these areas, 18% of the community do not have access to a latrine, 32% have no access to water and 96% of latrines do not have hand washing facilities. Many women who are in charge of waste disposal in their communities do not have the tools or the knowledge to collect and dispose of waste safely. This leads to the spread of diseases such as cholera, typhoid and childhood diarrhoea – one of the leading causes of deaths in under fives. With good sanitation and consistent access to healthy drinking water these conditions are easily preventable.',9.145000,40.489673,'health','Ethiopia'),(42,16,'Maternal, Newborn & Child Health','In this remote part of Uganda, skilled delivery and antenatal care attendance are very low and the mortality rate for mothers is much higher than the national average.  To improve this - Amref Health Africa UK in partnership with Comic Relief are working with local communities to increase skilled delivery, antenatal care and post natal care among pregnant women and mothers. ',1.373333,32.290275,'health','Uganda');
