INSERT INTO `organisations` VALUES (1,'AARP Foundation','AARP Foundation works to ensure that low-income vulnerable older Americans have nutritious food, affordable housing, a steady income, and strong and sustaining social bonds. We collaborate with individuals and organizations who share commitment to innovation and our passion for problem-solving. Supported by vigorous legal advocacy, we create and advance effective solutions that help struggling older adults transform their lives. AARP Foundation is AARP\'s affiliated charity.','elderly','giving@aarp.org','https://www.facebook.com/AARPFoundation'),(2,'Acorns Children\'s Hospice','Established in 1988, Acorns Children’s Hospice Trust is a registered charity offering a network of care for life limited and life threatened babies, children and young people and their families, across the heart of England. The children and young people that we help are not expected to reach adulthood and require specialist care 24 hours a day, 7 days a week. In the last year Acorns has supported 876 children and 1,097 families, including those who are bereaved.','children','info@acorns.org.uk','https://www.facebook.com/acornschildrenshospice'),(3,'Action Against Hunger','We save the lives of malnourished children. We ensure everyone can access clean water, food, training and healthcare. We enable entire communities to be free from hunger.','hunger','info@actionagainsthunger.org.uk','https://www.facebook.com/ActionAgainstHungerUK'),(4,'Action Deafness','Action Deafness aims to improve quality of life by promoting independence and equality of opportunity for Deaf, Deafened, Deafblind and Hard of Hearing people.','health','enquiries@actiondeafness.org.uk','https://www.facebook.com/ActionDeafness'),(5,'ActionAid','ActionAid works for a world where the most vulnerable and forgotten can become valued and powerful. Our top priority is to end the inequality that keeps women and girls locked in poverty, and to restore the rights denied them from birth. We want to see women and girls out of danger, out of poverty and on track to create the future they want.','equality','supportercontact@actionaid.org','https://www.facebook.com/ActionAid'),(6,'Acumen','Neither the markets nor aid alone can solve the problems of poverty. More than two billion people around the world lack access to basic goods and services—from clean water and electricity to an education and the freedom to participate in the economy. We’re here to change that. Our vision is a world based on dignity, where every human being has the same opportunity. Rather than giving philanthropy away, we invest it in companies and change makers.','poverty','info@acumen.org','https://www.facebook.com/acumenfund'),(7,'Adelson Foundation','The Adelson Family Foundation was established in 2007 by Dr. Miriam and Sheldon G. Adelson. The primary purpose of the Foundation is to strengthen the State of Israel and the Jewish people.','health','questions@adelsonfoundation.org','https://www.facebook.com'),(8,'ADRA','The Adventist Development and Relief Agency (ADRA) is the global humanitarian organization of the Seventh-day Adventist Church. Through an international network, ADRA delivers relief and development assistance to individuals in more than 130 countries—regardless of their ethnicity, political affiliation, or religious association. By partnering with communities, organizations, and governments, ADRA is able to improve the quality of life of millions through 9 impact areas. Learn more about Our Impact.','hunger','response@ADRA.org','https://www.facebook.com/joinADRA'),(9,'Aleh Negev','In 1982, a group of parents made a decision that would ultimately revolutionize life for Israel’s disability community: They would do everything possible to give their children with disabilities the best available care and the opportunity to grow and develop to their fullest capabilities. With great determination, they rented an apartment, hired a special education teacher and solicited a group of dedicated volunteers to assist them in fulfilling their goal.  From these humble beginnings, ALEH was formed.','children','zeevkirtchuk@bezeqint.net','https://www.facebook.com'),(10,'Alex\'s Lemonade Stand Foundation','ALSF founder Alexandra “Alex” Scott held her first front yard lemonade stand when she was just 4 years old and gave us our mission: to find cures for all children battling cancer.','health','alexlemonade@alm.org','https://www.facebook.com/alexslemonade'),(11,'Alexander S. Onassis Foundation','The Alexander S. Onassis Public Benefit Foundation was established in December 1975 in accordance with Aristotle Onassis\' last wish to honor the memory of his son, Alexander. The Alexander S. Onassis Public Benefit Foundation’s headquarters are located in Vaduz, Liechtenstein, as was directed in Aristotle Onassis\' will. Culture, education, the environment, health, and social solidarity come first on the agenda of the Alexander S. Onassis Public Benefit Foundation.','health','info.contact@onassis.org','https://www.facebook.com/'),(12,'TASC','TASC was formed in 2002 by former American Ambassador to Vietnam Douglas \"Pete\" Peterson and his wife, Vi Peterson. They have dedicated their lives to advocacy for children\'s health, recognizing that the prevention of child injury was a neglected area that they could make a real difference in. TASC’s main focus is reducing the number of preventable child deaths (aged 1-17) in Asia. Rather than focus on communicable and non-communicable diseases which are already a primary focus of many NGOs, TASC has concentrated on preventable deaths and morbidity resulting from injury. TASC is now in its second phase, implementing prevention programs within selected communities where community surveys have been completed. TASC is registered as a charitable organization in Thailand. TASC is also a registered charitable organization 501 (c) (3) in the USA. Our focus countries currently are Bangladesh, Cambodia, China, Indonesia, the Philippines, Thailand, and Vietnam. Our primary office is in Bangkok, Thailand, with a satellite office in Da Nang, Vietnam.','children','info@tasc-gcipf.org','https://www.facebook.com/The-Alliance-for-Safe-Children-17848123557/'),(13,'American Heart Association','To improve the lives of all Americans, we provide public health education in a variety of ways. We’re the nation’s leader in CPR education training. We help people understand the importance of healthy lifestyle choices. We provide science-based treatment guidelines to healthcare professionals to help them provide quality care to their patients. We educate lawmakers, policymakers and the public as we advocate for changes to protect and improve the health of our communities.','health','americanhearth@ah.org','https://www.facebook.com/AmericanHeart/'),(14,'ANERA','Incorporated in 1968 to help ease the suffering of Palestinian refugees after the Arab-Israeli War of 1967, ANERA is non-political and non-religious and is one of the largest American non-profits working solely in the Middle East for 50 years. ANERA helps local institutions become more self-sufficient and effective in serving their communities. Every project is planned in consultation with the communities that ultimately benefit — an approach that ensures relevancy and commitment, and secures the long-term viability of the projects.','equality','halmadhoun@anera.org','https://www.facebook.com/ANERAorg/'),(15,'British Red Cross','We are part of a global voluntary network, responding to conflicts, natural disasters and individual emergencies. We help vulnerable people in the UK and abroad prepare for, withstand and recover from emergencies in their own communities.','health','information@redcross.org.uk','https://www.facebook.com/BritishRedCross/'),(16,'Amref','Working primarily through women and girls, we bridge the gap between communities, health systems and governments.','health','info@amrefuk.org','https://www.facebook.com/amrefuk/'),(17,'Baan Gerda','BaanGerda is the only organization in Thailand that provides family-style homes for orphans, as well as comprehensive HIV care. We believe this structure plays a great role in the recovery and continued health of our children. They all attend school or kindergarten, while their foster parents take care of housekeeping and handicraft production.','children','k.moo@baangerda.org','https://www.facebook.com/'),(18,'Big Brothers Big Sisters of America','Big Brothers Big Sisters helps children realize their potential and build their futures. We nurture children and strengthen communities. And we couldn\'t do any of it without you.','children','donations@bbbs.org','https://www.facebook.com/BigBrothersBigSisters'),(19,'Bread for the World','Bread for the World has various methods for engaging individuals and groups (such as congregations, campuses and community groups) in its mission of ending hunger. Each year we set a policy-change agenda to move us closer to our goal. Our members and activists use our recurring methods described below to advance that agenda.','hunger','bread@bread.org','https://www.facebook.com/breadfortheworld'),(20,'The Canadian International Learning Foundation','The Canadian International Learning Foundation (CanILF) is a volunteer-run registered Canadian charity which provides education and mentors educators in areas of the world affected by war, illness and poverty (at-risk areas).','children','staff@canilf.org','https://www.facebook.com/'),(21,'Cancer Research UK','We fund scientists, doctors and nurses to help beat cancer sooner. We also provide cancer information to the public.','health','supporter.services@cancer.org.uk','https://www.facebook.com/cancerresearchuk'),(22,'Cardiac Risk in the Young','Since its formation in 1995, Cardiac Risk in the Young (CRY) has been working to reduce the frequency of young sudden cardiac death (YSCD). CRY supports young people diagnosed with potentially life-threatening cardiac conditions and offers bereavement support to families affected by YSCD. CRY promotes and develops heart screening programmes and funds medical research. CRY publishes and distributes medical information written by leading cardiologists for the general public. CRY funds specialist referral, screening and cardiac pathology services at leading UK hospitals.','health','cry@c-r-y.org.uk','https://www.facebook.com/CardiacRiskintheYoung/'),(23,'CARE (relief agency)','CARE is a global leader within a worldwide movement dedicated to ending poverty. We are known everywhere for our unshakeable commitment to the dignity of people.','hunger','info@care.org','https://www.facebook.com/carefans'),(24,'Cesvi','Cesvi operates worldwide with the conviction that helping the most needy populations, struck by wars, natural calamities and environmental disasters not only gives relief to those who suffer but also contributes to the wellbeing of all of us on the planet, our “shared home” to be preserved for future generations.','equality','cesvi@cesvi.org','https://www.facebook.com/cesvifondazioneonlus/'),(25,'Child In Need Institute','CINI is an Indian non-government organisation (NGO), regarded as one of the most influential institutions working for poor children in India. Over the past four decades, we have been partnering with central and state government, national and international donors, non-government organisations and local communities to strengthen the capacity of deprived children and women to improve their health, nutrition, education and protection conditions.','poverty','india@cini.org','https://www.facebook.com/cini.india'),(26,'Child\'s Dream','We focus on education because it is proven to be one of the most important factors for sustained social and economic development.','children','info@childsdream.org','https://www.facebook.com/childsdreamfoundation'),(27,'Children at Risk','We are a national charity that works with the country\'s most vulnerable children and young people. We listen. We support. We act. Because no child should feel alone.','children','supportercare@childrenssociety.org.uk','https://www.facebook.com/childrenssociety'),(28,'Children International','Like the world-changers who support our organization, we are focused on making a long-term impact by helping kids living in poverty. We have a bold vision: graduating healthy, educated, empowered and employed young adults from our program so they can achieve the goal of breaking the cycle of poverty. Period.','poverty','schildren@children.org','https://www.facebook.com/children/?ref=nf'),(29,'Children\'s Defense Fund','The Children’s Defense Fund Leave No Child Behind® mission is to ensure every child a Healthy Start, a Head Start, a Fair Start, a Safe Start and a Moral Start in life and successful passage to adulthood with the help of caring families and communities. ','children','cdfinfo@childrensdefense.org','https://www.facebook.com/ChildrensDefenseFund'),(30,'YouCan','Trustees and team realised that everyone we know has been impacted by cancer in some way so decided to set up YOUCAN to specifically support young people, covering so many important times, such as changing schools, going to Uni, starting work and planning a future. With positive guidance and support when you need it, we don’t offer any medical care at all, but we will be alongside during and after treatment, because we understand that you need that support long afterwards.','health','hello@you‑can.org.uk','https://www.facebook.com/YouCanSupport'),(31,'Children\'s Liver Disease Foundation','Children\'s Liver Disease Foundation (CLDF) was formed in 1980 and is a unique national charity dedicated to taking action against the effects of all liver diseases of childhood.','health','info@childliverdisease.org','https://www.facebook.com/CLDFonline/'),(32,'TCF','The Citizens Foundation (TCF) is a professionally managed, non-profit organization set up in 1995 by a group of citizens who wanted to bring about positive social change through education. 22 years later, TCF is now one of Pakistan’s leading organizations in the field of education for the less privileged.','equality','info@tcf.org.pk','https://www.facebook.com/TCF.Pak/'),(33,'Confetti Foundation','The foundation was started with the hope that families will be able to shift their focus from their child’s sickness for just 30 minutes and celebrate. Although the party is not a cure, it will be a welcome distraction and a good reminder that every child deserves to be celebrated.','children','CONFETTIFOUNDATION@GMAIL.COM','https://www.facebook.com/confettifoundation'),(34,'Counterpart International','In 1965, our founders, Betty Bryant Sliverstein and Father Stan Hosie started an organization to help the forgotten communities of the South Pacific because they believed in the right and ability of all people to drive their own destinies. Fifty-two years later, we continue to equip individuals, organizations and communities – our counterparts — to become solution creators in their own families, communities and countries.','equality','jjones@counterpart.org','https://www.facebook.com/counterpartinternational'),(35,'David and Lucile Packard Foundation','We are a family foundation guided by the enduring business philosophy and personal values of Lucile and David Packard.','equality','help@packard.org','https://www.facebook.com/PackardFoundation'),(36,'Dream Center','Our mission is to connect broken people to a community of support by offering free resources and services that address immediate and long-term needs in the areas of poverty, addiction, and abuse. The Dream Center serves as a resource center focused on finding solutions to homelessness, hunger, and the lack of education through residential and community outreach programs.','poverty','info@dreamcenter.org','https://www.facebook.com/LADreamCenter'),(37,'Drosos Foundation','Drosos Foundation is committed to enabling disadvantaged people to live a life of dignity.','equality','info@drosos.org','https://www.facebook.com/pages/Drosos-Foundation/1611136145796583'),(38,'The Duke Endowment','Since 1924, The Duke Endowment has worked to help people and strengthen communities in North Carolina and South Carolina by nurturing children, promoting health, educating minds and enriching spirits.','equality','infotde@tde.org','https://www.facebook.com/TheDukeEndowment/'),(39,'Epilepsy Foundation','We are leading the fight to overcome the challenges of living with epilepsy and to accelerate therapies to stop seizures, find cures, and save lives.','health','ContactUs@efa.org','https://www.facebook.com/EpilepsyFoundationofAmerica/'),(40,'Feeding America','The Feeding America network is the nation’s largest domestic hunger-relief organization, working to connect people with food and end hunger. Donors, staff, and volunteers all play an important role in our efforts to end hunger in the United States.','hunger','helo@feedamerica.org','https://www.facebook.com/FeedingAmerica'),(41,'FMSC','TFounded in 1987, Feed My Starving Children (FMSC) is a Christian non-profit that provides nutritionally complete meals specifically formulated for malnourished children.','hunger','info@fmsc.org','https://www.facebook.com/feedmystarvingchildren'),(42,'FINCA International','FINCA International, a Washington, D.C.-based not-for-profit, believes we can break down the vicious cycle of inter-generational poverty by creating economic justice and financial inclusion for all.','poverty','info@FINCA.org','https://www.facebook.com/FINCA.International'),(43,'Food Allergy Research & Reserach','FARE’s mission is to improve the quality of life and the health of individuals with food allergies, and to provide them hope through the promise of new treatments.','health','info@fare.org','https://www.facebook.com/FoodAllergyFARE'),(44,'Foundation for Child Development','The Foundation for Child Development identifies needs, fills gaps, and integrates knowledge for successful implementation and continuous improvement. Our website is a resource for building effective early childhood development systems.','children','info@fcd-us.org','https://www.facebook.com'),(45,'The Global Fund to Fight AIDS, Tuberculosis and Malaria','The Global Fund is a 21st-century partnership organization designed to accelerate the end of AIDS, tuberculosis and malaria as epidemics. Founded in 2002, the Global Fund is a partnership between governments, civil society, the private sector and people affected by the diseases. The Global Fund raises and invests nearly US$4 billion a year to support programs run by local experts in countries and communities most in need.','health','ccm@theglobalfund.org','https://www.facebook.com/theglobalfund'),(46,'GlobalGiving','GlobalGiving is the largest global crowdfunding community connecting nonprofits, donors, and companies in nearly every country. We help nonprofits from Afghanistan to Zimbabwe (and hundreds of places in between) access the tools, training, and support they need to be more effective and make our world a better place.','health','help@globalgiving.org','https://www.facebook.com/GlobalGiving/'),(47,'Global Village Foundation','The Global Village Foundation (GVF) is a non-profit humanitarian organization that serves the developing communities of rural SE Asia. We focus primarily on education, encouraging literacy and supporting local and regional arts and culture. We provide life lessons to local recipients and local and international volunteers through hands-on engagement at the grassroots level. GVF is a non-governmental, nonreligious, and nonpolitical 501(c)(3)organization based in California.','poverty','info@globalvillagefoundation.org','https://www.facebook.com'),(49,'Humanity & Inclusion','We work alongside people with disabilities and vulnerable populations, taking action and bearing witness in order to respond to their essential needs, improve their living conditions and promote respect for their dignity and fundamental rights.','equality','info.usa@hi.org','https://www.facebook.com/HIUS'),(50,'Points of Light','Points of Light’s network of volunteer action centers inspires, equips and mobilizes people to take action that changes the world. They put people at the center of change and connect them to their power to make a difference.','equality','info@pointsoflight.org','https://www.facebook.com/beapointoflight/'),(51,'International Children Assistance Network','We strive to possess in our work values of compassion, commitment, excellence, diversity and innovation because we believe that these same traits are ones that are most important in building a healthy community from village to society, from childhood to maturity and from one generation to the next.','equality','info@ican2.org','https://www.facebook.com/icansv'),(52,'International Trachoma Initiative','In 1998, the Edna McConnell Clark Foundation and Pfizer Inc. founded the International Trachoma Initiative (ITI) to help answer the World Health Organization’s call to eliminate blinding trachoma by 2020 .','health','info@iti.org','https://www.facebook.com/International-Trachoma-Initiative-118340048211972/'),(53,'Invisible Children, Inc.','From Day One, we have been driven by a firm belief in a universal idea: that our liberty is bound together. When we founded Invisible Children in 2004, we wanted to prove that idea through a specific mission: to end to Africa’s longest running conflict led by Joseph Kony and his Lord’s Resistance Army (LRA). We mobilized unprecedented international awareness and action to help end the LRA crisis, contributed to a 93% reduction in killings by the LRA, and we have helped thousands of central African families become safer through innovative community-based protection initiatives. In the process, our global team has gained unparalleled experience, developed renowned expertise, and cultivated a massive network of trusting relationships with resilient local changemakers across central Africa.','equality','info@ici.org','https://www.facebook.com/invisiblechildren'),(54,'Libra Foundation','The Libra Foundation takes UK students out to Romania to work in children’s residential centres, with children from Roma communities and with underprivileged Romanian children.  The charity\'s vision is of a more integrated Romanian society that celebrates the diversity and promotes the equality of its young people.','children','info@libraf.org','https://www.facebook.com/foundationlibra'),(55,'Lifeline Express','It was a simple dream. All it wanted was that people should not, through neglect or ignorance, become disabled or crippled, and thus robbed of health, productivity and joy, and that disabled persons especially in rural India should have access to medical services wherever they be. On 16th of July, 1991, this dream came true, when Impact India\'s Lifeline Express, the world\'s first hospital on a train, was launched. Upto December 2010, over 600,000 disabled poor in rural India have so far benefited from the remarkable train, and other countries have come forward to start their Lifeline Express on which major surgeries have been performed to restore movement, hearing, sight and correction of clefts with the help of the donated skills and services of over 80,000 surgeons, to make this dream possible.','health','info@impactindia.org','https://www.facebook.com/'),(56,'Make-A-Wish Foundation','We exist for one reason - to grant magical wishes to enrich the lives of children and young people fighting life-threatening conditions.','children','info@makeawish.org.uk','https://www.facebook.com/makeawish'),(57,'National Collegiate Cancer Foundation','The National Collegiate Cancer Foundation’s mission is to provide services and support to young adults who have been diagnosed with cancer.  Our goal is to help these survivors and their families establish a “Will Win” attitude in their fight.','health','info@collegiatecancer.org','https://www.facebook.com'),(58,'Nemours Foundation','Nemours is a nonprofit pediatric health system dedicated to: life-changing medical care and research; helping kids grow up healthy advocating for kids nationally; training tomorrow’s pediatric experts.','health','InternationalMedicine@nemours.org','https://www.facebook.com/Nemours/'),(59,'The Oaktree Foundation','Oaktree is young people leading a movement to end poverty.  For us, change starts with a simple belief - that extreme poverty is unacceptable. Beliefs turn into action, and enough informed action will end extreme poverty in our lifetime. Oaktree is Australia’s largest youth-run organisation with over 150,000 members. Join us.','poverty','hello@oaktree.org','https://www.facebook.com/oaktreeau/'),(60,'Operation Blessing International','Operation Blessing International (OBI) is a nonprofit 501(c)(3) humanitarian organization dedicated to demonstrating God’s love by alleviating human need and suffering in the United States and around the world. One of the largest charities in America, Operation Blessing provides strategic relief in 39 countries on an ongoing basis through core programs such as disaster relief, health and medical care, hunger relief, vulnerable children and orphan care, safe water and community development.','poverty','info@obi.org','https://www.facebook.com/operationblessing'),(61,'Operation Smile','Operation Smile is an international medical charity whose global network of thousands of credentialed medical volunteers from over 80 countries is committed to helping improve the health and lives of children from more than 60 countries. Since 1982, we\'ve worked with local medical professionals, governments, hospitals and other NGOs to deliver the safest care to each of our patients, and have established care centres wherever possible to give children ongoing medical treatment. Operation Smile continues to provide training and education for local medical professionals so they can provide care within their own communities and help others around the world. To date, we have provided more than 240,000 free surgeries for children and young adults born with cleft lip, cleft palate and other facial deformities.','poverty','info@operationsmile.org.uk','https://www.facebook.com/operationsmile/'),(62,'Oxfam','We make sure people can get clean water to drink and decent sanitation. We provide help for people to get food and the essentials they need to survive and ensure the most vulnerable are kept safe from harm. We support them in being better prepared to cope with shocks and uncertainties and we help rebuild communities to come back stronger from disaster and to face the future on their own terms. We\'re responding to emergencies around the world right now.','poverty','enquiries@oxfam.org.uk','https://www.facebook.com/Oxfam/'),(63,'Save the Children','With the support of people like you, we change the world for children through innovative work on the ground and campaigning for change on key issues.','children','supportercare@savethechildren.org.uk','https://www.facebook.com/savethechildrenuk'),(64,'Save the Children','With your help, we provide: Education; Life-saving food and nutrition; Clean water; Vaccines; Relief in emergencies; Protection from violence.','equality','info@unicef.org','https://www.facebook.com/Unicef.uk/'),(65,'United Nations Foundation','When disaster strikes, the world turns to one organization for hope, help, leadership, and coordi­nation: the United Nations. When there is peace to keep between warring factions, the world asks the UN to mobilize peacekeepers, oversee elections, and create stability. In the face of challenges such as climate change, disease or poverty, the United Nations provides the platform for international cooperation.','health','info@un.org','https://www.facebook.com/unitednationsfoundation'),(66,'Waste No Food','In California alone, there are billions of pounds of usable food wasted every year. Yet millions of people are hungry and in need of nourishment. WasteNoFood facilitates the exchange in a \"web based marketplace\" where aid groups can easily find, secure, and then deliver food to those who need it.','hunger','wastenofoodorg@gmail.com','https://www.facebook.com/WasteNoFood/'),(67,'World Medical Relief','Our mission is to facilitate the distribution of surplus medical resources where they are needed. As such, our programs have both a local, national and international focus.','health','info@worldmedicalrelief.org','https://www.facebook.com/World-Medical-Relief-Inc-92544848549/');
